D+VINE [LUV]

[RAW - No Subtitles, Japanese Audio / UNCENSORED / COMPLETE]


Adventures with hot, dripping sex!!! Hyde, along with his sidekick, Sakra, are treasure hunters. He finds plenty of action along the way; fighting off monsters, and saving a mysterious treasure-huntress, but especially when he comes across a sealed door that is unexpectedly opened by his amulet. Inside he finds a naked girl encased in ice, the amulet frees her and she falls into Hyde's arm...



